import { setup } from 'axios-cache-adapter'

const apiCodeContest = setup({
  baseURL: 'https://api.github.com/repos/minecode/code_contest',

  cache: {
    maxAge: 15 * 60 * 1000
  }
})

export default apiCodeContest
